import React from 'react';
import CardList from './CardList';
import {robot} from './Robot.js';
import SearchBar from './SearchBar';


class App extends React.Component{
	constructor(){
			this.state={
				robot:robot,
				searchfield:''
			}
		}
	render(){
		return(
		<div className="tc">
		<h1>RoboFriends</h1>
		<SearchBar/>
		<CardList robot={robot}/>
		</div>

		);
	}

}
export default App;
